import { Layout, Menu, Sider } from 'antd'
import React, { Component } from 'react';
import {Link, Routes, Route} from 'react-router-dom'

export default class ArtistList extends Component {
    render() {
        return (
            <Layout>
                <Sider>
                    
                </Sider>
                <Menu mode="inline" defaultSelectedKeys="hot" style={{width: 250}}>
                    <Menu.Item key="hot">热门歌手</Menu.Item>
                    <Menu.Item key="male">
                        <Link to="/artist/male">男歌手</Link>
                    </Menu.Item>
                    <Menu.Item key="female">女歌手</Menu.Item>
                    <Menu.Item key="group">组合/乐队</Menu.Item>
                </Menu>

            </Layout>
        )
    }
}
